import axios from 'axios';


export default function getComment(callback){
    axios(
        {
            url: '/comment/getList',
            method: 'get',
            baseURL: 'http://localhost:8888',
            withCredentials: true,
        }
    ).then(function(resource) {
        callback(resource.data);
    });
}
